            'paint': {
                'line-color': '#000000',
                'line-width': 2.2,
				'line-opacity': 0.6

            }
        });
        map.addSource('places', {

        places.features.forEach(function(feature) {

            if (!map.getLayer(layerID)) {

                    'layout': {
                    },
					'paint': {
						'circle-radius': 6,
						'circle-color':[ "match", ["get", "Service_type"], ["Community Support Service"], "#D55E00", ["Free to patient service, accepting self referrals "], "#0072B2", ["Free services referred by GP"], "#009E73", ["Advocacy Service"], "#E69F00",["Specialist referral"], "#56B4E9",["Inpatient Support Service"], "#CC79A7",["Online support"], "#F0E442","#000000" ],

					},
                    'filter': ['==', 'Life_course', symbol]
				});
	
                var input = document.createElement('input');
                input.type = 'checkbox';
                input.id = layerID;
                input.checked = true;
                filterGroup.appendChild(input);

                var label = document.createElement('label');
                label.setAttribute('for', layerID);
                label.textContent = symbol;
                filterGroup.appendChild(label);
				
                input.addEventListener('change', function(e) {
                    map.setLayoutProperty(
                        layerID,

                        e.target.checked ? 'visible' : 'none'
                    );
                });
            
			}
			
        });

	var Life_course = ['young people', 'adults', 'mixed ages','all ages'];
